import React from "react";
import Brandlink from "../Brandlink";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faFacebook, faTwitter, faInstagram} from '@fortawesome/free-brands-svg-icons';


const Footer = () => {

    const linksRow1 = [
        'about Welly',
        'affitiates',
        'supply chain',
        'siemap',
        'global sites',

    ];

    const linksRow2 = [
        'makeup',
        'skinare',
        'fragrance',
    ];

    const linksRow3 = [
        'Base',
        'contour',
        'eye makeup',   
        'lips',

    ];
    const linksRow4 = [
        'heir and nails',
        'vitamins',
        'nutrients',
    ];

    const linksRow5 = [
        'makeup',
        'skincare',
        'fragrance',
    ];

    return (
       <footer className=" bg-dark text-light flex justify-between px-4 py-4 pb-8">

        <Brandlink classes="text-yellow"/>

            <div className=" flex items-start ml-4">


                <div className="flex flex-col fl mr-10">
                    <h6 className=" ml-4 font-bold">about</h6> 
                { linksRow1.map((links, index  ) => (
                    <a key={index} href="/" className=" ml-4 hover:text-yellow"> {links}</a>
                ))} 
                </div>

                <div className="flex flex-col mr-4">
                    <h2 className=" ml-4 font-bold">skincare</h2>
                {linksRow2.map((links, index  ) => (
                    <a key={index} href="/" className=" ml-4 hover:text-yellow"> {links}</a>
                ))}
                </div> 

                <div className="flex flex-col mr-4">
                    <h2 className=" ml-4 font-bold">makup</h2>
                {linksRow3.map((links, index  ) => (
                    <a key={index} href="/" className=" ml-4 hover:text-yellow"> {links}</a>
                ))} 
                </div>

                <div className="flex flex-col mr-4">
                    <h2 className=" ml-4 font-bold">suppiements</h2>
                {linksRow4.map((links, index  ) => (
                    <a key={index} href="/" className=" ml-4 hover:text-yellow"> {links}</a>
                ))} 
                </div>

                <div className="flex flex-col mr-4">
                <h2 className=" ml-4 font-bold">luxury</h2>
                {linksRow5.map((links, index  ) => (
                    <a key={index} href="/" className=" ml-4 hover:text-yellow"> {links}</a>
                ))} 
                </div>
            </div>

            <div className=" flex flex-col">
                <FontAwesomeIcon className=" text-yellow mb-2 hover:text-white" icon={faFacebook} size='2x' />
                <FontAwesomeIcon className="  text-yellow mb-2 hover:text-white" icon={faTwitter} size='2x' />
                <FontAwesomeIcon className="  text-yellow mb-2 hover:text-white" icon={faInstagram} size='2x' />
            </div>


       </footer>
    )
}

export default Footer
